import './header.css';
import {useHistory} from "react-router-dom";
import {usePages} from "../../hooks/usePages/Usepages";

import {
    BrowserRouter as Router, 
    Link,
  } from "react-router-dom";
//cabecera unica para todas las paginas 

function HeaderMain() {
    let history = useHistory();
    const {isRecipesPage,isRecipesList}= usePages();

    return (
        <div className="header just_AR">
            
            
            {isRecipesPage && (<h1>RECETA</h1>)} 
            {isRecipesList && (<h1>LISTA DE RECETAS</h1>)} 
            {isRecipesPage && (<button onClick={history.goBack}>Atras</button>)} 
            {isRecipesList && (<Link to="/recipes/new"><button>Crear Receta</button></Link>)} 
             
        </div>
    );
}

export default HeaderMain;
